import axiosInstance from './axios-instance';

export const getMethod = async (url) => {
    try {
      await axiosInstance({
        url: url,
        method: "GET",
      }).then((res) => {
        //console.log(res.data);
        return res.data;
      });
    } catch (e) {
      console.error(e);
    }
}
